export const getCartData = async () => {
  let data = []
  try {
    const res = await fetch('', {
      headers: {
        'Cache-Control': 'no-cache', // Disable caching
        'Pragma': 'no-cache',
      },
    })
    console.log(res)


  }
  catch (error) {
    console.log(error)
  }
  return data
}
